import React from 'react'
import "../stylesheets/Navbar.css"
import { Link } from 'react-scroll'

class Navbar extends React.Component {


    render() {
        return(
            <div id="navbar-wrapper">
                <ul id="navbar-ul">
                    <Link><li className='navbar-li' to="home" smooth={true} spy={true} duration={1000}>HOME</li></Link>
                    <Link><li className='navbar-li' to="about" smooth={true} spy={true} duration={1000}>ABOUT</li></Link>
                    <Link><li className='navbar-li' to="portfolio" smooth={true} spy={true} duration={1000}>PORTFOLIO</li></Link>
                    <Link><li className='navbar-li' to="blog" smooth={true} spy={true} duration={1000}>BLOG</li></Link>
                    <Link><li className='navbar-li' to="contact" smooth={true} spy={true} duration={1000}>CONTACT</li></Link>
                </ul>
            </div>
        )
    }
}

export default Navbar
